const BtnCloseFormReg = () => {
  return (
    <div
      style={{
        width: '50px',
        height: '50px',
      }}
    >
      <svg
        xmlns="http://www.w3.org/2000/svg"
        width="50"
        height="50"
        viewBox="0 0 50 50"
        fill="none"
      >
        <circle cx="25" cy="25" r="24" stroke="#7E0000" stroke-width="2" />
        <path d="M16 33.6776L33.6777 15.9999" stroke="#7E0000" />
        <path d="M16 15.9999L33.6777 33.6775" stroke="#7E0000" />
      </svg>
    </div>
  )
}

export default BtnCloseFormReg
